import React from "react";
import { Text, View, Image } from "react-native";

export default function Login() {
  return (
    <View
      style={{ flex: 1, justifyContent: "flex-start", alignItems: "center" }}
    >
      <View style={{ flex: 1, backgroundColor: "green" }}>
        <Image
          style={{
            width: 150,
            height: 150,
          }}
          source={{
            uri: "https://images.unsplash.com/photo-1574436782441-05ef8ab77077?ixid=MnwxMjA3fDB8MHxzZWFyY2h8NDR8fGhlYWRwaG9uZXN8ZW58MHx8MHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60",
          }}
        />
        <Text style={{ color: "black" }}>Hello</Text>
      </View>
      <View style={{ flex: 1, backgroundColor: "red" }}>
        <Text>Excited to enter the wold of headphones?!</Text>
      </View>
    </View>
  );
}
